import React from "react";
import Header from "../../components/header/Header";
import Form from "./Form";
function SignupPage(){
    return(
        <div>
            <Header/>
            <h2>Sign up to get started. It's free and always will be.</h2>
            <Form/>
        </div>
    );
}
export default SignupPage;
